import React, {Component} from 'react';
import Post from './post.component.js'
import axios from 'axios';
const BACK_PORT = 4000;

export default class Home extends Component {

    constructor(props){
        super(props);

        this.state = { posts: [] }
                      //images: []  };
    }

    componentDidMount(){
        axios.get(`http://localhost:${BACK_PORT}/molten/posts`)
            .then(res => {
                this.setState({posts: res.data,
                });
                //this.getImageUrls();
            })
            .catch(function (error){
                console.log(error);
            })
    }

    postList(){
        var history = this.props.history;

        return this.state.posts.map(function(currentPost, i){
            return <Post post={currentPost} key={i} history={history}/>
        })
    }

    render(){
        return (
            <div>
                {this.postList()}
            </div>
        )
    }
}
